import {addPostAC, profilePagePropsType, profileReducer} from "./profile-reducer";
import {v1} from "uuid";

let startState: profilePagePropsType;

beforeEach(() => {
    startState = {
        postData: [
            {
                id: v1(),
                name: "Beth",
                message: "Hello",
                likesCount: 12,
                avatar: "data:image/jpeg;base64,"
            },
            {
                id: v1(),
                name: "Beth",
                message: "Guys!",
                likesCount: 11,
                avatar: "data:image/jpeg;base64,"
            },
            {
                id: v1(),
                name: "Beth",
                message: "This is my new post",
                likesCount: 3,
                avatar: "data:image/jpeg;base64,"
            },
            {
                id: v1(),
                name: "Beth",
                message: "This is my new post Guys",
                likesCount: 44,
                avatar: "https://pbs.twimg.com/media/D9wcZfeX4AAUZi0.jpg"
            }
        ],
        profile: null,
        status: ""
    }
})


test('new post should be added', () => {
    let avatar = "https://sun9-55.userapi.com/impf/4OVa92OuK5A2PL1OkHkfDHRK41EaNgTpv860Tw/DVztYSAWFbA.jpg?size=512x512&quality=96&sign=2df645602452340721ae5fcaeffc49ae&type=album"
    let action = addPostAC("Test", avatar)
    let newState = profileReducer(startState, action)

    expect(newState.postData.length).toBe(5)
    expect(newState.postData[4].message).toBe("Test")
})
